Your passport to the most beautiful &amp; stunning places in the world begins with Vacation Quest: The Hawaiian Islands! Explore exotic Hawaiian locations to complete tours &amp; fill your vacation journal with achievements. Collect hidden Seashells to extend your tropical vacation by up to 7 days &amp; unlock 7 bonus locations for even more Hidden Object fun!

* Incredible gameplay
* Fantastic locations
* Go on an ultimate vacation!


System Requirements:

* OS: Windows XP/Vista/Win7 x86/x64
* CPU: 600 Mhz
* RAM: 128 MB
* DirectX: 6.0
* Hard Drive: 58 MB


